						Finobe General Guidelines
					</div> <div class="card-body"><ol><li>You must be at least 13 years of age before registering.</li> <li>Don’t be racist or hateful. If you use a racist word (<i>e.g.</i> any variant of the N word) or a slur (<i>e.g.</i> the homophobic slur starting with F), you will be banned.</li> <li>Don’t be immature. For example, erotic roleplay and general sexual behaviour are not allowed. Comments about the human reproductive system are not allowed either.</li> <li>Don’t cause drama.</li> <li>Don’t exploit servers. Don’t post IP trackers on the forum either.</li> <li>Don’t bully or attack other people. Everybody messes up from time to time. In that regard, be respectful and understanding of other users.</li> <li>Don’t grief servers. You will be banned for griefing if an admin deems it necessary. User reports will not be taken for this infraction.</li> <li>Don't make off-site deals or you'll be permanently banned. What happens on Finobe <i>stays</i> on Finobe.</li> <li>Don't farm Dius or attempt to manipulate the economy. You are not allowed to create alternate accounts for the purpose of gaining more Dius on your main account.</li> <li>Don’t make death threats. You will be permanently banned if you make any death threats.</li> <li>Don’t evade bans by the usage of alternate accounts. If you are found evading a ban, all of your accounts will be permanently banned.</li> <li>Don’t downvote things just because you don’t like them. The downvote button is present to show that something doesn’t belong somewhere.</li> <li>Don’t sell invite keys and don’t use sold invite keys. Any accounts that use purchased invite keys will be banned.</li> <li>Don’t scam or manipulate users for personal gain. Your trading rights may be revoked for such actions, and you may even be permanently banned for larger offenses. For example, don’t try to convince users that an item is worth more than its actual worth.</li> <li>Don’t create an offensive or otherwise inappropriate username. For example, usernames with slurs, bodily functions, and other things that would be considered “immature” are not allowed.</li></ol> <p class="mb-0">You should use your common sense. These are the most common infractions that we take action against. If something is not listed here, it doesn't mean it's not against the rules.</p></div></div></div></div></div> <div class="container"><div class="row"><div class="col-md-8 offset-md-2"><div class="card"><div class="card-header bg-primary text-light">
